import axios from "axios";

import { GET } from "../types";
import { url } from "./pages";

export const getData = (page) => async (dispatch) => {
  try {
    const res = await axios.get(`${url}/api/pages/${page}/`);
    dispatch({
      type: GET,
      payload: res.data,
      page: page,
    });
  } catch (err) {
    console.error(err);
    dispatch(getData(page));
  }
};
